import React, { useState, useEffect, useCallback } from 'react';
import Switch from 'react-switch';
function App() {
  const [pokemon, setPokemon] = useState(null);
  const [loading, setLoading] = useState(false);
  const [query, setQuery] = useState("");
  const [searchType, setSearchType] = useState("manual");

  const fetchPokemon = useCallback(async () => {
    if (!query) return; 
    setLoading(true);
    try {
      const res = await fetch(`http://localhost:3001/api/pokemon/${query}`);
      const data = await res.json();
      setPokemon(data);
    } catch (err) {
      console.error("Fetch error:", err);
      setPokemon(null);
    }
    setLoading(false);
  }, [query]);

  useEffect(() => {
    if (searchType === 'auto') {
      fetchPokemon(); // Pencarian otomatis setiap kali query berubah
    }
  }, [fetchPokemon, query, searchType]);

  // Fungsi untuk menangani input pada kolom pencarian
  const handleInputChange = (e) => {
    setQuery(e.target.value.toLowerCase());
  };

  // Fungsi untuk menangani pencarian manual (tombol Enter atau klik Search)
  const handleManualSearch = (e) => {
    if (e.key === 'Enter' || e.type === 'click') {
      fetchPokemon();
    }
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Pokémon Search</h1>

      <div style={styles.switchContainer}>
        <label style={styles.switchLabel}>Auto Search:</label>
        <Switch
          onChange={() => setSearchType(searchType === "auto" ? "manual" : "auto")}
          checked={searchType === "auto"}
          offColor="#888"
          onColor="#4caf50"
          offHandleColor="#fff"
          onHandleColor="#fff"
          height={30}
          width={60}
        />
      </div>

      <div style={styles.searchBox}>
        <input
          style={styles.input}
          value={query}
          onChange={handleInputChange}
          onKeyPress={handleManualSearch}  // Menangani Enter pada input
          placeholder="Enter Pokémon name"
        />
        <button
          style={styles.searchButton}
          onClick={handleManualSearch}
        >
          Search
        </button>
      </div>

      {loading && <p>Loading...</p>}

      {pokemon && pokemon.name ? (
        <div style={styles.pokemonDetails}>
          <h2>{pokemon.name.toUpperCase()}</h2>
          <img src={pokemon.sprites.front_default} alt={pokemon.name} style={styles.image} />
          <p><strong>Height:</strong> {pokemon.height}</p>
          <p><strong>Weight:</strong> {pokemon.weight}</p>
          <p><strong>Type:</strong> {pokemon.types.map(t => t.type.name).join(', ')}</p>
        </div>
      ) : !loading && <p>No Pokémon found.</p>}
    </div>
  );
}

const styles = {
  container: {
    padding: 20,
    fontFamily: 'Arial, sans-serif',
    backgroundColor: '#f4f4f9',
    minHeight: '100vh',
  },
  title: {
    textAlign: 'center',
    fontSize: '2.5rem',
    color: '#333',
    marginBottom: '20px',
  },
  switchContainer: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    marginBottom: '20px',
  },
  switchLabel: {
    fontSize: '1.2rem',
    marginRight: '10px',
    color: '#333',
  },
  searchBox: {
    display: 'flex',
    justifyContent: 'center',
    marginBottom: '20px',
  },
  input: {
    padding: '10px',
    fontSize: '1.2rem',
    marginRight: '10px',
    border: '1px solid #ddd',
    borderRadius: '5px',
    width: '300px',
    outline: 'none',
  },
  searchButton: {
    padding: '10px 20px',
    backgroundColor: '#4caf50',
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    fontSize: '1.2rem',
    cursor: 'pointer',
  },
  pokemonDetails: {
    marginTop: '20px',
    textAlign: 'center',
    backgroundColor: '#fff',
    padding: '20px',
    borderRadius: '10px',
    boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
  },
  image: {
    width: '150px',
    height: '150px',
  },
};

export default App;
